import Navbar from './Navbar';
import Home from './Home';
import Pratice from './Pratice';

function App() {
  return (
    <div className="App">
      <Navbar />
      <div className="content">
        <Home />
      <Pratice/>
      </div>
    </div>
  );
}

export default App;
